     - "      LogicalProject(l_orderkey=[$17], o_orderdate=[$12], o_shippriority=[$15], $f3=[*($22, -(1, $23))])"
     - "        LogicalFilter(condition=[AND(=($6, 'HOUSEHOLD'), =($0, $9), =($17, $8), <($12, 1995-03-25), >($27, 1995-03-25))])"
