  description: "12.sql"
  input:
   - "-- tpch12 using 1395599672 as a seed to the RNG"
   - "select"
   - "  l.l_shipmode,"
   - "  sum(case"
   - "    when o.o_orderpriority = '1-URGENT'"
   - "      or o.o_orderpriority = '2-HIGH'"
   - "      then 1"
   - "    else 0"
   - "  end) as high_line_count,"
   - "  sum(case"
   - "    when o.o_orderpriority <> '1-URGENT'"
   - "      and o.o_orderpriority <> '2-HIGH'"
   - "      then 1"
   - "    else 0"
   - "  end) as low_line_count"
   - "from"
   - "  cp.\"tpch/orders.parquet\" o,"
   - "  cp.\"tpch/lineitem.parquet\" l"
   - "where"
   - "  o.o_orderkey = l.l_orderkey"
   - "  and l.l_shipmode in ('TRUCK', 'REG AIR')"
   - "  and l.l_commitdate < l.l_receiptdate"
   - "  and l.l_shipdate < l.l_commitdate"
   - "  and l.l_receiptdate >= date '1994-01-01'"
   - "  and l.l_receiptdate < date '1994-01-01' + interval '1' year"
   - "group by"
   - "  l.l_shipmode"
   - "order by"
   - "  l.l_shipmode "
  output:
    queryPlanText:
     - "LogicalSort(sort0=[$0], dir0=[ASC])"
     - "  LogicalAggregate(group=[{0}], high_line_count=[SUM($1)], low_line_count=[SUM($2)])"
     - "    LogicalProject(l_shipmode=[$23], $f1=[CASE(OR(=($5, '1-URGENT'), =($5, '2-HIGH')), 1, 0)], $f2=[CASE(AND(<>($5, '1-URGENT'), <>($5, '2-HIGH')), 1, 0)])"
     - "      LogicalFilter(condition=[AND(=($0, $9), OR(=($23, 'TRUCK'), =($23, 'REG AIR')), <($20, $21), <($19, $20), >=($21, 1994-01-01), <($21, DATETIME_PLUS(1994-01-01, 12)))])"
     - "        LogicalJoin(condition=[true], joinType=[inner])"
     - "          LogicalTableScan(table=[[cp, tpch/orders.parquet]])"
     - "          LogicalTableScan(table=[[cp, tpch/lineitem.parquet]])"
