  description: "17.sql"
  input:
   - "-- tpch17 using 1395599672 as a seed to the RNG"
   - "select"
   - "  sum(l.l_extendedprice) / 7.0 as avg_yearly"
   - "from"
   - "  cp.\"tpch/lineitem.parquet\" l,"
   - "  cp.\"tpch/part.parquet\" p"
   - "where"
   - "  p.p_partkey = l.l_partkey"
   - "  and p.p_brand = 'Brand#13'"
   - "  and p.p_container = 'JUMBO CAN'"
   - "  and l.l_quantity < ("
   - "    select"
   - "      0.2 * avg(l2.l_quantity)"
   - "    from"
   - "      cp.\"tpch/lineitem.parquet\" l2"
   - "    where"
   - "      l2.l_partkey = p.p_partkey"
   - "  ) "
  output:
    queryPlanText:
     - "LogicalProject(avg_yearly=[/($0, 7.0)])"
     - "  LogicalAggregate(group=[{}], agg#0=[SUM($0)])"
     - "    LogicalProject(L_EXTENDEDPRICE=[$5])"
     - "      LogicalFilter(condition=[AND(=($16, $1), =($19, 'Brand#13'), =($22, 'JUMBO CAN'), <($4, $25))])"
     - "        LogicalCorrelate(correlation=[$cor0], joinType=[left], requiredColumns=[{16}])"
     - "          LogicalJoin(condition=[true], joinType=[inner])"
     - "            LogicalTableScan(table=[[cp, tpch/lineitem.parquet]])"
     - "            LogicalTableScan(table=[[cp, tpch/part.parquet]])"
     - "          LogicalProject(EXPR$0=[*(0.2, $0)])"
     - "            LogicalAggregate(group=[{}], agg#0=[AVG($0)])"
     - "              LogicalProject(L_QUANTITY=[$4])"
     - "                LogicalFilter(condition=[=($1, $cor0.P_PARTKEY)])"
     - "                  LogicalTableScan(table=[[cp, tpch/lineitem.parquet]])"
